('04ebd7de-1814-4f71-ba89-b5eac484a431', '54', '2022-06-17 09:46:40', '54', '2022-06-17 09:46:40', NULL, b'0', 'aa', 'aa', 'SELECT COUNT(*) FROM asset\nWHERE code = \'##code##\'\nAND id = \'##id##\'\nAND created_by = \'##userid##\';'),
('dbeed0cd-905c-4ac6-ab01-e064a9d637ed', '54', '2022-06-13 10:19:25', '871fab87-38ce-4b76-ade8-2ec7bc24b477', '2022-06-20 10:50:57', NULL, b'0', 'businessobject', 'Business Object', 'SELECT  bo.id AS a, bo.code AS b, bo.name AS c, s.code AS d, s.name AS e, c.code AS f, c.name AS g\nFROM data_catalog_business_object bo\nINNER JOIN data_catalog_service s ON bo.data_catalog_service_id = s.id\nINNER JOIN data_catalog_category c ON s.data_catalog_category_id = c.id\nWHERE  bo.id = \'##bo_id##\'');
