INSERT INTO `search` (`id`, `created_by`, `created_on`, `modified_by`, `modified_on`, `short_order`, `access_control_enabled`, `name`, `query`) VALUES
('1', NULL, '2022-04-21 12:20:48', NULL, '2022-05-31 15:22:57', NULL, b'0', 'Rita Search', 'SELECT icon, icon_color, title, description, navigation FROM\n\n(\nSELECT \'fa-tasks\' AS icon,\n\'#39b531\' AS icon_color,\n\'<b>Asset</b>\' AS title,\nCONCAT(\'Asset with code <b>\',code,\'</b> and name <b>\',name,\'</b>\') AS description,\nCONCAT(\'FORM[LOCATE:(ID=11;SELECTION-ID=\',id,\'),TITLE:ASSET-\',name,\']\') AS navigation,\ncreated_on\nFROM `asset`\nWHERE code LIKE :search\nAND created_by = :userid\n\nUNION ALL\n\nSELECT \'fa-exclamation-circle\' AS icon,\n\'#5190c1\' AS icon_color,\n\'<b>Threat</b>\' AS title,\nCONCAT(\'Threat with code <b>\',code,\'</b> and name <b>\',name,\'</b>\') AS description,\nCONCAT(\'FORM[LOCATE:(ID=12;SELECTION-ID=\',id,\'),TITLE:Threat\',name,\']\') AS navigation,\ncreated_on\nFROM threat\nWHERE code LIKE :search\nAND created_by = :userid\n\nUNION ALL\n\nSELECT \'fa-shield-alt\' AS icon,\n\'#66615B\' AS icon_color,\n\'<b>Counter Measure</b>\' AS title,\nCONCAT(\'Counter Measure with code <b>\',code,\'</b> and name <b>\',name,\'</b>\') AS description,\nCONCAT(\'FORM[LOCATE:(ID=18;SELECTION-ID=\',id,\'),TITLE:Counter Measure \',name,\']\') AS navigation,\ncreated_on\nFROM countermeasure\nWHERE code LIKE :search\nAND created_by = :userid\n\nUNION ALL\n\nSELECT \'fa-bezier-curve\' AS icon,\n\'#5654ff\' AS icon_color,\n\'<b>Composite Asset</b>\' AS title,\nCONCAT(\'Composite Asset with code <b>\',code,\'</b> and name <b>\',name,\'</b>\') AS description,\nCONCAT(\'FORM[LOCATE:(ID=23;SELECTION-ID=\',id,\'),TITLE:Composite Asset \',name,\']\') AS navigation,\ncreated_on\nFROM composite_asset\nWHERE code LIKE :search\nAND created_by = :userid\n\nUNION ALL\n\nSELECT \'fa-briefcase\' AS icon,\n\'#17a2b8\' AS icon_color,\n\'<b>Business Service</b>\' AS title,\nCONCAT(\'Business Service with code <b>\',code,\'</b> and name <b>\',name,\'</b>\') AS description,\nCONCAT(\'FORM[LOCATE:(ID=25;SELECTION-ID=\',id,\'),TITLE:Business Service \',name,\']\') AS navigation,\ncreated_on\nFROM business_service\nWHERE code LIKE :search\nAND created_by = :userid\n\nUNION ALL\n\nSELECT \'fa-balance-scale\' AS icon,\n\'#ef8157\' AS icon_color,\n\'<b>Risk Assessment</b>\' AS title,\nCONCAT(\'Risk Assessment with code <b>\',code,\'</b> and name <b>\',name,\'</b>\') AS description,\nCONCAT(\'FORM[LOCATE:(ID=15;SELECTION-ID=\',id,\'),TITLE:Risk Assessment \',name,\']\') AS navigation,\ncreated_on\nFROM risk_assessment\nWHERE code LIKE :search\nAND created_by = :userid\n)  results\nORDER BY created_on\nLIMIT 30\n');
